CREATE DEFINER=`root`@`localhost` PROCEDURE `cargarComentarios` (IN `inIdPublicacion` INT)  SELECT usuarios.nombre as usuario, comentarios.id as idComentario, comentarios.texto as texto, comentarios.tags as tags, comentarios.imagen as imagen FROM comentarios inner join usuarios on comentarios.idUsuario = usuarios.id WHERE comentarios.idPublicacion = inIdPublicacion$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `guardarImagen` (IN `inImagen` BLOB)  UPDATE usuarios
SET imagen = inImagen
ORDER by usuarios.id desc
limit 1$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `guardarImagenC` (IN `inImagen` BLOB)  UPDATE comentarios
SET imagen = inImagen
ORDER by comentarios.id desc
limit 1$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `guardarImagenP` (IN `inImagen` BLOB)  UPDATE publicacions
SET imagen = inImagen
ORDER by publicacions.id desc
limit 1$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `guardarImagenR` (IN `inImagen` BLOB)  UPDATE respuestas
SET imagen = inImagen
ORDER by respuestas.id desc
limit 1$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedimientoCargarPublicaciones` (IN `inIdUsuario` INT)  SELECT * FROM `publicacions` WHERE tipo='publica' or idUsuario = inIdUsuario or publicacions.idUsuario in ( select amistads.idUsuario1 from amistads where amistads.idUsuario2 = inIdUsuario union select amistads.idUsuario2 from amistads where amistads.idUsuario1 = inIdUsuario )$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedimientoLikesPublicacion` (`inIdPublicacion` INT)  SELECT usuarios.nombre FROM usuarios INNER JOIN likes ON usuarios.id = likes.idUsuario and likes.idPublicacion = inIdPublicacion$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedimientoLogin` (IN `inCorreo` VARCHAR(250), IN `inPassword` VARCHAR(250))  SELECT id,nombre
FROM `usuarios` 
WHERE (usuarios.correo = inCorreo) and (usuarios.password=inPassword)$$

